CommandSet.JavascriptSDKCode:
var processResponse= function(data, d, sdk) 
{
    var splitData = data.toString().split("\r");

    splitData.forEach(function(dataString){
        if(dataString.contains("~:ss")){
            var scenes = dataString.replace("~:ss ", "").replace(String.fromCharCode(13), "").replace(String.fromCharCode(10), "");
            sdk.setDeviceVariableValue(d, "Unit_1_Scene", scenes[0]);
            sdk.setDeviceVariableValue(d, "Unit_2_Scene", scenes[1]);
            sdk.setDeviceVariableValue(d, "Unit_3_Scene", scenes[2]);
            sdk.setDeviceVariableValue(d, "Unit_4_Scene", scenes[3]);
            sdk.setDeviceVariableValue(d, "Unit_5_Scene", scenes[4]);
            sdk.setDeviceVariableValue(d, "Unit_6_Scene", scenes[5]);
            sdk.setDeviceVariableValue(d, "Unit_7_Scene", scenes[6]);
            sdk.setDeviceVariableValue(d, "Unit_8_Scene", scenes[7]);
        }

        if(dataString.contains("~:zi")){
            var intensities= dataString.replace("~:zi ", "").replace(String.fromCharCode(13), "").replace(String.fromCharCode(10), "");
            var zones = intensities.split(" ");
            var unitId = zones[0];

            for(var i =1; i < zones.length; i++){
                sdk.setDeviceVariableValue(d, "Unit" + unitId.toString() + "_Zone_" + i.toString() + "_Intensity", parseInt(zones[i], 16).toString());
            }
        }
        if(dataString.contains("~:ip")){
            var ip= dataString.replace("~:ip ", "").replace(String.fromCharCode(13), "").replace(String.fromCharCode(10), "");
            sdk.setDeviceVariableValue(d, "IPAddress", ip);
        }

    });
}
exports.processResponse= processResponse;
